import { AxiosInstance } from "axios";
import { User } from "../types/models/User.model";
import api from "../config/Api";
export type Image_Post = {
  id: number;
  image: string;
  description: string;
  likes: number;
  author: User;
};
const ImageService = {
  getImage: async () => {
    try {
      const response = await api.get("/imagepost/getAll");
      return response.data;
    } catch (error) {
      console.error("ERRORRRRRRRR", error);
      return [];
    }
  },
  addImage: async (params: AddRickAndMortyRequest) => {
    const res = await api.post("/rickandmorty", params);
    if (res && res.status === 200) {
      console.log(",character successfully created");
    }
  }
};
export default ImageService;
